import React, { Component } from 'react'
import axios from "axios";
class Landing extends Component {
  constructor(props) {
    super(props);
    this.state = {
        Posts: []
    };
}
getPostsData() {
    axios
        .get(`localhost:5000/questions/showAll`, {})
        .then(res => {
            const data = res.data;
            console.log(data);
            const posts = data.map(u =>
              <div>
              <p>{u.questionTitle}</p>
              <p>{u.questionText}</p>
              </div>
              );
              this.setState({posts})

        })
        .catch((error) => {
            console.log(error)
        })

}
componentDidMount(){
    this.getPostsData()
}
  render() {
    return (
      <div className="container">
        <div className="jumbotron mt-5">
          <div className="col-sm-8 mx-auto">
            <h1 className="text-center">askIT</h1>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-8 mx-auto">
              {
                <p>{this.state.posts}</p>
              }
          </div>
        </div>
      </div>
    )
  }
}

export default Landing;
